import React from 'react';

function Projects() {
  return (
    <div className="section">
      <h2>My Projects</h2>
      <ul>
        <li>portfolio website</li>
        <li>To-Do List App</li>
        </ul>
        <p>This is current portfolio site build using React </p>
      </div>
  );
}

export default Projects;
